import React from 'react';
import { Row } from 'reactstrap';
import './../assets/scss/custom/_body.scss'
const Body = () => {
    return(
        <div className="body">
            <div style={{
                display: 'flex',
                flexDirection: 'row',
            }}>
                <Row>
                    <div>
                        Teste
                    </div>
                </Row>

            </div>
        </div>
    )
}

export default Body;
